import React, { Fragment, Component } from 'react';
import PaypalCheckoutButton from './PaypalCheckoutButton';

/*
* By AFelipe MX  @afelipelc
*/

function Paypal() {

  const order = {
    customer: '123456',
    total: '550.00',
    items: [
      {
        sku: '112',
        name: 'Camisa ReactJS',
        price: '300.00',
        quantity: 1,
        currency: 'MXN'
      },
      {
        sku: '99',
        name: 'Camisa JS',
        price: '125.00',
        quantity: 2,
        currency: 'MXN'
      },
    ],
  };

  return (
    <div className="App">
      <header className="App-header">
        <PaypalCheckoutButton order={order} />
      </header>
    </div>
  );
}

export default Paypal;
